import React from "react";
import pic from "../assets/Profilepic.png";
const Chat = () => {
  return (
    <div className="h-auto w-screen flex flex-col mt-10">
      {/* header */}
      <header className="w-full h-[4rem] bg-white ">
        <div className="w-[80%] h-[90%] mx-auto my-auto flex flex-row justify-between">
          {/* profile */}
          <div className="flex flex-row w-[60%]">
            {/* icon - back arrow */}
            <div></div>
            {/* profile,name */}
            <div className="flex flex-row space-x-3 justify-center">
              {/* photo */}
              <div className="rounded-full h-[2.75rem] w-[2.75rem] relative before:absolute before:bottom-[10%] before:right-[5%] before:w-[0.5rem] before:h-[0.5rem] before:rounded-full before:bg-[#2BEF83] ">
                <img
                  src={pic}
                  alt=""
                  className=" w-full h-full rounded-full "
                />
              </div>

              {/* name */}
              <div className="flex flex-col space-y-1 justify-center items-start">
                <h2 className=" font-medium non-italic text-[1rem] leading-[1rem] text-[#69235B]">
                  Arya
                </h2>
                <p className="text-[#797C7B] text-[0.75rem] font-thin leading-[0.75rem]">
                  Vedic AI Bot
                </p>
              </div>
            </div>
          </div>

          {/* languages */}
          <div className="">
            <h2 className="text-[#FBBC04]">A/A</h2>
          </div>
        </div>
      </header>

      {/* messages */}
      <div></div>
    </div>
  );
};

export default Chat;
